    public void Awake()
    {
        Image[] images = gameObject.GetComponentsInChildren<Image>();
        strengthBar = images[1];
        barScreen = images[2];
        TMPro.TMP_Text[] texts = gameObject.GetComponentsInChildren<TMPro.TMP_Text>();
        text = texts[0];

        text.text = "";
        barScreen.rectTransform.offsetMin = new Vector2(0f, 0f);
        input.onValueChanged.AddListener(delegate { OnInputValueChange(); });
        nonPassword = false;
    }

    public int GetIndex(string c)
    {
        char cc;
        cc = c.ToLower()[0];
        if (cc < 'a' || cc > 'z')
        {
            return 0;
        }
        return (int)cc - ((int)'a' - 1);
    }

    public int GetCharsetSize(string password)
    {
        int a = 0;
        int u = 0;
        int n = 0;
        int ns = 0;
        int r = 0;
        int sp = 0;
        int s = 0;
        int chars = 0;

        for (int i = 0; i < password.Length; i++)
        {
            char c = password[i];

            if (a == 0 && "abcdefghijklmnopqrstuvwxyz".IndexOf(c) >= 0)
            {
                chars += 26;
                a = 1;
            }

            if (u == 0 && "ABCDEFGHIJKLMNOPQRSTUVWXYZ".IndexOf(c) >= 0)
            {
                chars += 26;
                u = 1;
            }

            if (n == 0 && "0123456789".IndexOf(c) >= 0)
            {
                chars += 10;
                n = 1;
            }

            if (ns == 0 && "!@#$%^&*()".IndexOf(c) >= 0)
            {
                chars += 10;
                ns = 1;
            }

            if (r == 0 && "`~-_=+[{]}\\|;:'\",<.>/? ".IndexOf(c) >= 0)
            {
                chars += 22;
                r = 1;
            }

            if (sp == 0 && c == ' ')
            {
                chars += 1;
                sp = 1;
            }

            if (s == 0 && (c < ' ' || c > '~'))
            {
                chars += 32 + 128;
                s = 1;
            }
        }
        return chars;
    }

    public void GetStrength(string pass)
    {
        if (nonPassword)
        {
            text.text = "";
            barScreen.rectTransform.offsetMin = new Vector2(0f, 0f);
            return;
        }

        string lowPass = pass.ToLower();

        if (pass.Length == 0)
        {
            text.text = "";
            barScreen.rectTransform.offsetMin = new Vector2(0f, 0f);
            return;
        }

        for (int i = 0; i < commonWords.Length; i++)
        {
            if (commonWords[i] == lowPass)
            {
                text.text = "Terrible";
                text.color = darkRed;
                strengthBar.color = darkRed;
                barScreen.rectTransform.offsetMin = new Vector2(100f, 0f);
                return;
            }
        }

        if (pass.Length > 1)
        {
            int bidx = 0;
            float c = 0f;
            float bits = 0f;
            float charset = Mathf.Log(GetCharsetSize(pass)) / Mathf.Log(2);
            int aidx = GetIndex(lowPass[0].ToString());
            for (int b = 1; b < lowPass.Length; b++)
            {
                bidx = GetIndex(lowPass[b].ToString());
                c = 1.0f - frequencyTable[aidx * 27 + bidx];
                bits += charset * c * c;
                aidx = bidx;
            }

            if (bits < 28)
            {
                text.text = "Terrible";
                text.color = darkRed;
                strengthBar.color = darkRed;
                barScreen.rectTransform.offsetMin = new Vector2(100f, 0f);
            }

            else if (bits < 36)
            {
                text.text = "Weak";
                text.color = orange;
                strengthBar.color = orange;
                barScreen.rectTransform.offsetMin = new Vector2(200f, 0f);
            }

            else if (bits < 60)
            {
                text.text = "Reasonable";
                text.color = yellow;
                strengthBar.color = yellow;
                barScreen.rectTransform.offsetMin = new Vector2(300f, 0f);
            }

            else if (bits < 128)
            {
                text.text = "Strong";
                text.color = green;
                strengthBar.color = green;
                barScreen.rectTransform.offsetMin = new Vector2(400f, 0f);
            }

            else
            {
                text.text = "Excellent";
                text.color = darkGreen;
                strengthBar.color = darkGreen;
                barScreen.rectTransform.offsetMin = new Vector2(500f, 0f);
            }
        }
    }

    public void SetNonPassword(bool value)
    {
        nonPassword = value;
    }

    public void OnInputValueChange()
    {
        GetStrength(input.text);
    }
